css:
atom-text-editor,
:host {
  background-color: #fcfcfc;
  color: #18191a;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(24, 25, 26, 0.2);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(24, 25, 26, 0.2);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(24, 25, 26, 0.2);
}
atom-text-editor .gutter,
:host .gutter {
  color: #667380;
}
atom-text-editor .invisible,
:host .invisible {
  color: #18191a;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #18191a;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #b0b0b0;
}
atom-text-editor .is-focused .selection .region,
:host .is-focused .selection .region {
  background-color: #b9d7fd;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(185, 215, 253, 0.35);
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border: 1px solid #bdbdbd;
  box-sizing: border-box;
}
atom-text-editor::shadow .find-result .region {
  background-color: #fdfd97;
  border-radius: 0;
  z-index: -1;
}
atom-text-editor::shadow .current-result .region,
atom-text-editor::shadow .current-result ~ .highlight.selection .region {
  background-color: #d5e798;
  border-color: #d5e798;
  border-radius: 0;
  z-index: -1;
}
.comment {
  color: #757873;
}
.comment .keyword {
  color: inherit;
}
.entity.c,
.entity.clojure,
.entity.cs,
.entity.coffee,
.entity.gfm,
.entity.git-config,
.entity.go,
.entity.java,
.entity.makefile,
.entity.objc,
.entity.objcpp,
.entity.perl6,
.entity.perl,
.entity.php,
.entity.python,
.entity.ruby,
.entity.shell,
.entity.sql {
  color: #0088cc;
}
.entity.name.function.constructor,
.entity.name.function.scss {
  color: #0088cc;
}
.entity.name.section {
  color: #0072ab;
}
.entity.name.tag {
  color: #0072ab;
}
.entity.name.tag.mustache {
  color: #d97e00;
}
.entity.name.tag.wildcard {
  color: #18191a;
}
.entity.name.tag.yaml {
  color: #0088cc;
}
.entity.name.type {
  color: #0088cc;
}
.entity.name.type.instance,
.entity.name.type.object {
  color: #0072ab;
}
.entity.name.type .punctuation.separator.inheritance {
  color: #18191a;
}
.entity.other.attribute-name {
  color: #0088cc;
}
.entity.other.attribute-name.attribute {
  color: #0072ab;
}
.entity.other.attribute-name.parent-selector,
.entity.other.attribute-name.pseudo-class,
.entity.other.attribute-name.pseudo-element {
  color: #18191a;
}
.keyword {
  color: #d97e00;
}
.keyword.control.at-rule {
  color: #0088cc;
}
.keyword.control.at-rule .keyword {
  color: inherit;
}
.keyword.control.html.elements {
  color: #0072ab;
}
.keyword.operator {
  color: #18191a;
}
.keyword.operator.control,
.keyword.operator.cpp,
.keyword.operator.delete,
.keyword.operator.in,
.keyword.operator.instanceof,
.keyword.operator.logic.media,
.keyword.operator.new,
.keyword.operator.of,
.keyword.operator.sizeof,
.keyword.operator.typeof,
.keyword.operator.void {
  color: #d97e00;
}
.keyword.operator.logical.control {
  color: #18191a;
}
.keyword.operator.logical.perl,
.keyword.operator.logical.python {
  color: #d97e00;
}
.keyword.other.unit {
  color: #2cbb0f;
}
.storage {
  color: #d97e00;
}
.storage.type.arrow {
  color: #18191a;
}
.storage.type.string {
  color: #d97e00;
}
.constant.character.entity,
.constant.language {
  color: #ed2655;
}
.constant.numeric {
  color: #2cbb0f;
}
.constant.other.bareword,
.constant.other.java,
.constant.other.key,
.constant.other.property {
  color: #0088cc;
}
.constant.other.color.rgb-value,
.constant.other.rgb-value {
  color: #ed2655;
}
.constant.other.rune {
  color: #f13c00;
}
.constant.other.symbol {
  color: #d97e00;
}
.variable.c,
.variable.clojure,
.variable.cs,
.variable.coffee,
.variable.git-config,
.variable.go,
.variable.java,
.variable.makefile,
.variable.objc,
.variable.objcpp,
.variable.perl6,
.variable.perl,
.variable.python,
.variable.ruby,
.variable.shell,
.variable.sql,
.variable.toml,
.variable.other.property,
.variable.parameter.function {
  color: #0088cc;
}
.variable.gfm {
  color: #f13c00;
}
.variable.language {
  color: #d97e00;
}
.variable.php {
  color: #18191a;
}
.string {
  color: #f13c00;
}
.string.other.math,
.string .embedded {
  color: #18191a;
}
.string .keyword.regexp {
  color: inherit;
}
.punctuation.definition.entity,
.punctuation.definition.variable {
  color: inherit;
}
.punctuation.definition.entry,
.punctuation.definition.table {
  color: #18191a;
}
.punctuation.definition.string {
  color: inherit;
}
.punctuation.definition.string.html,
.punctuation.definition.string.xml {
  color: #18191a;
}
.punctuation.other.period + .support.function {
  color: #0088cc;
}
.punctuation.section.array {
  color: #18191a;
}
.punctuation.section.embedded.coffee,
.punctuation.section.embedded.js,
.punctuation.section.embedded.ruby {
  color: #f13c00;
}
.punctuation.section.embedded.erb,
.punctuation.section.embedded.php {
  color: #d97e00;
}
.punctuation.section.function + .constant.other.color.rgb-value {
  color: #2cbb0f;
}
.punctuation.separator.key-value {
  color: #18191a;
}
.support.class {
  color: #0072ab;
}
.support.class.cocoa,
.support.class.quartz {
  color: #d97e00;
}
.support.constant.color.w3c-standard-color-name,
.support.constant.property-value {
  color: #ed2655;
}
.support.constant.font-name {
  color: #0072ab;
}
.support.constant.js,
.support.constant.media {
  color: #0088cc;
}
.support.function {
  color: #0072ab;
}
.support.function.any-method.c,
.support.function.any-method.objc {
  color: #0088cc;
}
.support.function.magic {
  color: #0088cc;
}
.support.type.property-name {
  color: #0088cc;
}
.meta.at-rule.import .support.function {
  color: #ed2655;
}
.meta.delimiter.method + .support.function,
.meta.function.arguments .variable.other,
.meta.symbol {
  color: #0088cc;
}
.meta.function .entity.name.function,
.meta.method .entity.name.function,
.meta.method-call .entity.name.function {
  color: #0088cc;
}
.meta.function-call.object,
.meta.function-call.static {
  color: #0088cc;
}
.meta.function-call.python {
  color: #0088cc;
}
.meta.function-call.python .punctuation {
  color: #18191a;
}
.meta.method-call .meta.method {
  color: #0088cc;
}
.meta.method-call .meta.method.delimiter.period {
  color: inherit;
}
.meta.property-value .variable.parameter.misc {
  color: #f13c00;
}
.meta.scope.prerequisites {
  color: #0072ab;
}
.meta.structure.json.dictionary > .string.quoted {
  color: #0088cc;
}
.meta.structure.json.dictionary > .string.quoted > .punctuation.string {
  color: #18191a;
}
.meta.structure.json.array > .value > .string.quoted,
.meta.structure.json.dictionary > .value > .string.quoted,
.meta.structure.json.array > .value > .string.quoted > .punctuation,
.meta.structure.json.dictionary > .value > .string.quoted > .punctuation {
  color: #f13c00;
}
.meta.tag.string {
  color: inherit;
}
.underline {
  text-decoration: underline;
}
.invalid {
  border-bottom: 1px dashed #ed2655;
}
.invalid.deprecated {
  border-bottom-color: #d97e00;
}
.markup.bold {
  color: #0088cc;
  font-weight: bold;
}
.markup.changed {
  color: #d97e00;
}
.markup.deleted {
  color: #ed2655;
}
.markup.heading {
  color: #0072ab;
}
.markup.inserted {
  color: #2cbb0f;
}
.markup.italic {
  color: #0088cc;
  font-style: italic;
}
.markup.link.gfm {
  color: #f13c00;
}
.markup.raw {
  color: #d97e00;
}
.markup.strike {
  color: #757873;
}
.source.go .entity.name.function {
  color: #0088cc;
}
